                        {/* email input */}
                        <input
                            type="text"
                            value={myEmail}
                            onChange={e => updateEmailTest(e.target.value)}
                        />
                    </div>

                    <div>
                        {/* password input */}
                        <input
                            type="password"
                            // value={myPassword}
                            onChaneg={e => updatePassword(e.targe.value)}
                        />
